    }

    render() {
        return(
            <div className="controls-container">
                <Link className="controls-button" to={"/AdminDashboard/AdminDashboard"}>Admin Dashboard</Link>
                <Link className="controls-button" to={"/"}>Sales</Link>
                <Link className="controls-button" to={"/AdminDashboard/AdminDashboard"}>Products</Link>
                <Link className="controls-button" to={"/AdminDashboard/CreateProduct"}>Create Product</Link>
                {/*<Link className="controls-button" to={"/"}>TODO</Link>*/}
            </div>

        )

    }


}
